import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { ArrowLeft } from 'lucide-react';

const ResultsPage = () => {
  const [trafficData, setTrafficData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [debugInfo, setDebugInfo] = useState(null);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    const searchParams = new URLSearchParams(location.search);
    const name = searchParams.get('name');
    const address = searchParams.get('address');

    const fetchTrafficData = async () => {
      setDebugInfo(null);
      try {
        // Step 1: Use Google Places API to get detailed information
        const googleApiKey = 'AIzaSyBUE_42ctF3i-1x77Wec5d3bSRLQpzzWN0'; // Replace with your actual Google API key
        const googlePlacesUrl = `https://maps.googleapis.com/maps/api/place/findplacefromtext/json?input=${encodeURIComponent(name + ' ' + address)}&inputtype=textquery&fields=place_id,name,formatted_address,geometry&key=${googleApiKey}`;

        setDebugInfo(prev => ({ ...prev, googlePlacesUrl }));

        const googleResponse = await fetch(googlePlacesUrl);
        const googleData = await googleResponse.json();

        setDebugInfo(prev => ({ ...prev, googleResponse: googleData }));

        if (googleData.status !== 'OK' || !googleData.candidates || googleData.candidates.length === 0) {
          throw new Error('No venues found in Google Places');
        }

        const place = googleData.candidates[0];

        // Step 2: Use BestTime API to get forecast
        const besttimeUrl = `https://besttime.app/api/v1/forecasts?` + 
          new URLSearchParams({
            api_key_private: 'pri_070565f833f9459aad223978a7a19b74',
            venue_name: place.name,
            venue_address: place.formatted_address,
            venue_lat: place.geometry.location.lat,
            venue_lon: place.geometry.location.lng
          });

        setDebugInfo(prev => ({ ...prev, besttimeUrl }));

        const besttimeResponse = await fetch(besttimeUrl);
        const besttimeData = await besttimeResponse.json();

        setDebugInfo(prev => ({ ...prev, besttimeResponse: besttimeData }));

        if (besttimeData.status !== 'OK') {
          throw new Error(besttimeData.message || 'Failed to fetch forecast data');
        }

        setTrafficData({ ...besttimeData, venue_info: place });
      } catch (err) {
        setError(err.message || 'Failed to fetch traffic data. Please try again later.');
        console.error('API Error:', err);
      } finally {
        setLoading(false);
      }
    };

    if (name && address) {
      fetchTrafficData();
    } else {
      setError('No venue information provided.');
      setLoading(false);
    }
  }, [location.search]);

  const formatDateTime = (dateTimeString) => {
    return new Date(dateTimeString).toLocaleString('en-US', {
      weekday: 'long',
      year: 'numeric',
      month: 'long',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-2xl mx-auto">
        <button 
          onClick={() => navigate('/')}
          className="flex items-center text-blue-600 hover:text-blue-800 mb-6"
        >
          <ArrowLeft className="mr-2" size={20} />
          Back to Search
        </button>

        {loading && (
          <div className="text-center text-gray-600">
            Loading traffic data...
          </div>
        )}

        {error && (
          <div className="text-center text-red-500 mb-4">
            Error: {error}
          </div>
        )}

        {trafficData && !loading && !error && (
          <div className="bg-white rounded-lg shadow-md p-6">
            <h1 className="text-2xl font-bold mb-4">{trafficData.venue_info.name}</h1>
            <div className="mb-4">
              <h2 className="text-lg font-semibold mb-2">Current Traffic</h2>
              <p className="text-xl">
                {trafficData.analysis?.now?.intensity_txt || 'Data not available'}
                {trafficData.analysis?.now?.intensity !== undefined && (
                  <span className="ml-2 text-sm text-gray-500">
                    (Level: {trafficData.analysis.now.intensity})
                  </span>
                )}
              </p>
            </div>
            <div className="mb-4">
              <h2 className="text-lg font-semibold mb-2">Address</h2>
              <p>{trafficData.venue_info.formatted_address}</p>
            </div>
            {trafficData.venue_info.venue_timezone && (
              <div className="mb-4">
                <h2 className="text-lg font-semibold mb-2">Time Zone</h2>
                <p>{trafficData.venue_info.venue_timezone}</p>
              </div>
            )}
            {trafficData.forecast_updated_on && (
              <div>
                <h2 className="text-lg font-semibold mb-2">Last Updated</h2>
                <p>{formatDateTime(trafficData.forecast_updated_on)}</p>
              </div>
            )}
          </div>
        )}

        {debugInfo && (
          <div className="mt-8 bg-gray-200 p-4 rounded">
            <h2 className="text-lg font-semibold mb-2">Debug Information</h2>
            <pre className="whitespace-pre-wrap">{JSON.stringify(debugInfo, null, 2)}</pre>
          </div>
        )}
      </div>
    </div>
  );
};

export default ResultsPage;
